function validDate(date){ // date   31.12.2014
  var d_arr = date.split('.');
  var d = new Date(d_arr[2]+'/'+d_arr[1]+'/'+d_arr[0]+''); //    2014/12/31
  if (d_arr[2]!=d.getFullYear() || d_arr[1]!=(d.getMonth() + 1) || d_arr[0]!=d.getDate()) {
    return false; //  
  };
  return true;
}


