	function uploadRR_old(file,id) {

		var xhr = new XMLHttpRequest();

		//     ,
		//  status == 200,   ,  
		xhr.onload = xhr.onerror = function() {
			// alert(this.status);
			if (this.status == 200) {

				$('[id_upload='+id+']').show(); //
				$('.scap_load_'+id).find('.scap_load__').width(0);
				$('.scap_load_'+id).hide();
				$('.scap_load_'+id).after();
				//UpdateImageReports(id);
				alert_message('ok','  ');
				autoReloadHak();
			} else {

				$('[id_upload='+id+']').show();
				$('.scap_load_'+id).find('.scap_load__').width(0);
				$('.scap_load_'+id).hide();
			}
		};

		//   
		xhr.upload.onprogress = function(event) {
			$('[id_upload='+id+']').hide();
			$('.scap_load_'+id).show();
			var widths=Math.round((event.loaded*100)/event.total);
			$('.scap_load_'+id).find('.scap_load__').width(widths+'%');
		}

		xhr.open("POST", "users/upload.php", true);
		//xhr.send(file);

		var formData = new FormData();
		formData.append("thefile", file);
		formData.append("id",id);
		xhr.send(formData);

	}







